import { Route, Routes} from "react-router-dom";
function AdminOrderInfo({ orders }) {
    console.log("hi")
  return (
    <Routes>
      {orders&&orders.data.OrderFind.map((order) => {
        return (
          <Route
            path={"/editOrders/" + order._id}
            element={<div>hello {order._id}</div>}
            key={"route" + order._id}
          />
        );
      })}
    </Routes>
  );
}
export default AdminOrderInfo;
